import Vue from "vue";
import Router from "vue-router";

Vue.use(Router);

import Home from "@/pages/";

export default new Router({
  routes: [
    {
      path: "/",
      name: "home",
      component: Home,
    },
    {
      path: "/example",
      name: "example",
      component: Example,
    },
  ],
});
